text:
 @leobarbosa3901  A equipa era a mesma e na minha opinião suficiente para ser campeã! 
viu-se a diferença entre ter um bom treinador e não ter e quando o Bruno Lage cometeu alguns erros e perdeu parte da vantagem conquistada pelo Luís Castro, quiseram logo que ele fosse despedido e desse lugar a um treinador brasileiro. O que veio a comprovar-se ter sido um grande erro...
Eu tenho muitas dúvidas que o Bruno Lage tivesse deixado fugir o título, mas isso nunca teremos a certeza...
